" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 488px\">",
"   <div class=\"ttl\">",
"    Tetralogy of Fallot",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 468px; height: 369px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
