"     <a class=\"outlineLink\" href=\"#H6572959\">",
"      IMPACT OF INDIVIDUAL FACTORS OR COMORBIDITIES",
"     </a>",
"    </li>",
"    <li class=\"bulletItem\">",
"     <a class=\"outlineLink\" href=\"#H6572968\">",
"      Age",
"     </a>",
"    </li>",
"    <li class=\"bulletItem\">",
"     <a class=\"outlineLink\" href=\"#H6244469\">",
"      Renal dysfunction",
"     </a>",
