var title_f18_50_19242="Leukoerythroblastic blood smear";
var content_f18_50_19242=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F68110%7EHEME%2F55274&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F68110%7EHEME%2F55274&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Leukoerythroblastic peripheral blood smear",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 360px; height: 244px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Leukoerythroblastic peripheral blood smear showing the presence of nucleated red cells and immature white cells. This pattern occurs with marrow replacement, usually due to fibrosis that may be idiopathic (eg, primary myelofibrosis) or reactive to conditions such as metastatic cancer.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Carola von Kapff, SH (ASCP).",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal peripheral blood smear",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 393px; height: 257px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    High power view of a normal peripheral blood smear. Several platelets (black arrows) and a normal lymphocyte (blue arrow) can also be seen. The red cells are of relatively uniform size and shape. The diameter of the normal red cell should approximate that of the nucleus of the small lymphocyte; central pallor (red arrow) should equal one-third of its diameter.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Carola von Kapff, SH (ASCP).",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Teardrop-shaped red blood cells (dacrocytes)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 305px; height: 288px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This peripheral smear from a patient with bone marrow fibrosis shows numerous teardrop-shaped red cells (arrows). Note that the teardrops are pointed in several different directions, ruling out an artifact due to preparation of the smear.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Carola von Kapff, SH (ASCP).",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal peripheral blood smear",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 393px; height: 257px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    High power view of a normal peripheral blood smear. Several platelets (black arrows) and a normal lymphocyte (blue arrow) can also be seen. The red cells are of relatively uniform size and shape. The diameter of the normal red cell should approximate that of the nucleus of the small lymphocyte; central pallor (red arrow) should equal one-third of its diameter.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Carola von Kapff, SH (ASCP).",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
