"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F75820&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=13\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
