"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Recommendations for total and rate of weight gain during pregnancy, by prepregnancy BMI",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"2\">",
"        Total weight gain",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"2\">",
"        Rates of weight gain*",
"        <br/>",
"        2nd and 3rd trimester",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        Prepregnancy BMI",
"       </td>",
"       <td class=\"subtitle2\">",
"        Range in kg",
"       </td>",
"       <td class=\"subtitle2\">",
"        Range in lbs",
"       </td>",
"       <td class=\"subtitle2\">",
"        Mean (range) in kg/week",
"       </td>",
"       <td class=\"subtitle2\">",
"        Mean (range) in lbs/week",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Underweight (&lt;18.5 kg/m",
"        <sup>",
"         2",
"        </sup>",
"        )",
"       </td>",
"       <td>",
"        12.5-18",
"       </td>",
"       <td>",
"        28-40",
"       </td>",
"       <td>",
"        0.51 (0.44-0.58)",
"       </td>",
"       <td>",
"        1 (1-1.3)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Normal weight (18.5-24.9 kg/m",
"        <sup>",
"         2",
"        </sup>",
"        )",
"       </td>",
"       <td>",
"        11.5-16",
"       </td>",
"       <td>",
"        25-35",
"       </td>",
"       <td>",
"        0.42 (0.35-0.50)",
"       </td>",
"       <td>",
"        1 (0.8-1)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Overweight (25.0-29.9 kg/m",
"        <sup>",
"         2",
"        </sup>",
"        )",
"       </td>",
"       <td>",
"        7-11.5",
"       </td>",
"       <td>",
"        15-25",
"       </td>",
"       <td>",
"        0.28 (0.23-0.33)",
"       </td>",
"       <td>",
"        0.6 (0.5-0.7)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Obese (&ge;30.0 kg/m",
"        <sup>",
"         2",
"        </sup>",
"        )",
"       </td>",
